import React from "react";
import "./Repos.css";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";

export default function Repos(props) {
  //   console.log(props.repos);

  const displayRepos = (props) => {
    const { repos } = props;
    // console.log(repos);
    if (repos.length > 0) {
      return repos.map((repo) => {
        return (
          <div className="App w-100 min-vh-100 justify-content-center align-items-center d-flex">
            <Card style={{ width: "18rem" }} key={repo.id}>
              {/* <Card.Img variant="top" src="img/logo192.png" /> */}
              <Card.Body>
                <Card.Title>{repo.name}</Card.Title>
                <Card.Text>
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
          </div>
        );
      });
    } else {
      return <h3>No Repos yet</h3>;
    }
  };

  return displayRepos(props);
}
